templeMap::templeMap()
{
	Init();
	DrawOwnScn();
}

templeMap::~templeMap()
{
}

void templeMap::Update(Vector2 offset)
{	
	mOffset = { offset.x_,offset.y_ };
}

void templeMap::DrawOwnScn()
{
	DrawBox(0, 0, 1080, 609, 0x0000ff, true);
	for (int x = 0; x < MAP_X; x++)
	{
		for (int y = 0; y < MAP_Y; y++)
		{
			mMap1[y][x] = tsoil[y][x];
			mMap2[y][x] = pillar[y][x];
			mMap3[y][x] = temple[y][x];
			mMap4[y][x] = wall[y][x];
			mMap5[y][x] = tobj1[y][x];

			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[mMap1[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[mMap2[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[mMap3[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[mMap4[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[mMap5[y][x]], true);
		}
	}
}

bool templeMap::Init(void)
{
	if (LoadDivGraph("./image/map.png", 2800, 56, 50, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}
	return true;
}

int templeMap::GetMapChip(Vector2 pos)
{
	return mMap[pos.y_ / 32][pos.x_ / 32];
}
